import { useState } from "react";

const PirateLogin = () => {
  return (
    <div id="pirateHome">
      Enter userId : <input type="text" />
      New Password : <input type="password" />
      New User ? <br />
      <a href="/piratesignup"> SignUP</a>
    </div>
  );
};

export default PirateLogin;
